import Fuse from 'fuse.js';
import './App.css';
import characters from './character.json';
import Search from './components/search';

function App() {
  const fuse = new Fuse(characters, {
    keys: [
      'word'
    ]
  });
  const results = fuse.search('hp');
  console.log(results);
  return (
    <Search/>
  );
}

export default App;
